        var $province = $(this);
        var county = countyData ? $(countyData.$).pullDownList(countyData, type, notInit) : undefined;
        var city = cityData ? $(cityData.$).pullDownList($.extend({ relevance: county }, cityData), type, notInit) : undefined;
